const Technologies = () => {
    return (
      <div className="Technologies">
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>JavaScript</li>
          <li>React.js</li>
        </ul>
      </div>
    );
}

export default Technologies;
